package com.simplilearn.literals;

public class LiteralsExample {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		System.out.println("i am first line\n");
		System.out.println("i am second line\n");
		System.out.println("i am third line\n");
		
		//In these line there is no \n means in consol the result is 
		//i m first line i am second line i am third line but in the presence of \n the result is (new line) 
		// i am first line 
		// i m second line 
		// i am third line 

	}

}
